import Todo from './components/Todo';


function App() {
    const[inputText,setInputText] = useState("");
    const [todos,setTodos] = useState([]);
    return (
      <div className="App">
        <header>
          <h1>Ed's Todo List </h1>
        </header>
        <Form 
          inputText={inputText}
          todos={todos} 
          setTodos={setTodos}
          setInputText={setInputText}
          />
        <ToDoList setTodos={setTodos} todos={todos} />
      </div>
    );
  }

export default App;
